import InterestService from '../services/interests.service'

class Interests {
    getInterestsKeyword = (object) => {
        let interests = object.map(a => a.keyword)
        return interests
    }

    getAllAvailableInterests = () =>{
        let interest_list = [];
        InterestService.getInterestList(data => {
            interest_list = this.getInterestsKeyword(data);
        })
        return interest_list;
    }

}

export default new Interests();
